import { createStore } from 'redux';
import {v4 as uuid} from 'uuid';

const initialState = {
    products : [
        {
            id: uuid(),
            title: 'Comfy headphones',
            description: 'This headphone will sooth your ears entire day',
            price: 1500,
            image: 'data:image/jpeg;base64,'
        },
        {
            id: uuid(),
            title: 'Macbook Pro',
            description: 'The best thing for your work from home',
            price: 80000,
            image: 'data:image/jpeg;base64,'
        },
        {
            id: uuid(),
            title: 'Gamepad joystick',
            description: 'The best gaming experience with smooth and best controls',
            price: 3000,
            image: 'data:image/jpeg;base64,'
        }
    ],
    cart: []
};

export const store = createStore(
    reducer,
    initialState
);

function reducer(state, action){
    switch(action.type){
        case 'ADD_TO_CART':
            const item = state.products.find((product)=> product.id === action.payload.id);
            const ifPresentInCart = state.cart.find((item)=> item.id === action.payload.id);

            return {
                ...state,
                cart: ifPresentInCart ? state.cart.map((item) => item.id === action.payload.id ?
                 { ...item, quantity: item.quantity+1} 
                 : item) : [...state.cart, {...item, quantity: 1}] 
            }
        case 'REMOVE_FROM_CART':
            return {
                ...state,
                cart: state.cart.filter((item)=> item.id !== action.payload.id)
            }
        case 'ADJUST_QUANTITY':
            return {
                ...state,
                cart: state.cart.map((item) => item.id === action.payload.id ? {...item, quantity: action.payload.quantity} : item)
            }          
        default: 
            return state;
        }
}

export const addToCart = (itemID) => {
    return {
        type: 'ADD_TO_CART',
        payload : {
            id: itemID
        }
    }
}

export const removeFromCart = (itemID) => {
    return {
        type: 'REMOVE_FROM_CART',
        payload : {
            id: itemID
        }
    }
}

export const adjustQuantity = (itemID, quantity) => {
    return {
        type: 'ADJUST_QUANTITY',
        payload : {
            id: itemID,
            quantity
        }
    }
}